import { Anchor } from '@codecademy/gamut';
import React from 'react';

export type SectionItemLinkProps = {
  onClick: (event: React.MouseEvent) => void;
  href: string;
};

export const SectionItemLink: React.FC<SectionItemLinkProps> = ({
  onClick,
  href,
  children,
}) => {
  return (
    <Anchor
      variant="interface"
      display="block"
      width="max-content"
      href={href}
      onClick={onClick}
    >
      {children}
    </Anchor>
  );
};
